INSERT INTO `components_landing_sections` VALUES (1,'<p>Copyright info</p>'),(2,'<p>Licencing</p>'),(3,'<h2 style=\"text-align:center;\">Terminology</h2><p style=\"text-align:center;\">Search, manage and share your terms with our next-gen terminology solution.</p><p style=\"text-align:center;\">Enhanced functionality, seamless intergration and unprecedented consistency.</p>'),(4,'<div class=\"raw-html-embed\"><div class=\"row\">\n  <div class=\"col-xs-12 col-lg-6\">\n    <h3 class=\"page-heading\">Info about the plugin</h3>\n    <p>SDL Trados Studio is a CAT tool and translation memory software that provides features to help translate faster and more easily.</p>\n  </div>\n  <div class=\"col-xs-12 col-lg-6\">\n      <div class=\"float-lg-right\">\n        <div class=\"mb-2\"><h3 class=\"page-heading\">Download plugin</h3></div>\n        <div style=\"width: 395px; background-color: #dee2e6 ; border-radius: 4px;\" class=\"p-4 text-align: right;\">\n          <a type=\"button\" href=\"https://appstore.sdl.com/language/app/tilde-term-provider/511/\" style=\"width: 100%;\" class=\"btn btn-primary mb-2 p-2 d-flex\">\n                <span class=\"flex-grow-1 d-flex\"> <img src=\"/uploads/download_white_8e16614281.svg\" alt=\"\" style=\"margin-right: 8px; border: none;\">Download from SDL store</span>\n          </a>\n                <a type=\"button\" href=\"https://tilde.com/sites/default/files/downloads/TildeTerm.2021.sdlplugin\" style=\"width: 100%; text-align: right; font-size: 12px;\">\n                      Download for version 2021\n                </a>\n                    <a type=\"button\" href=\"https://tilde.com/sites/default/files/downloads/TildeTerm.2019.sdlplugin\" style=\"width: 100%; text-align: right; font-size: 12px;\">\n                      Download for version 2019\n                    </a>\n                    <a type=\"button\" href=\"https://tilde.com/sites/default/files/downloads/TildeTerm.2017.sdlplugin\" style=\"width: 100%; text-align: right; font-size: 12px;\">\n                      Download for version 2017\n                    </a>\n           \n        </div>\n      </div>\n    </div>\n  </div></div><h3><strong>Instructions for use</strong></h3><ul><li>Download the TildeTerm plug-in for SDL Trados Studio and double click the file, SDL Plugin Installer will be opened.</li><li>Click “Next” and agree to the terms of the licence</li><li>In the next step choose the SDL Trados version you want to install the plugin for. If there are several versions installed on the same computer the list will contain all of them. If the version is greyed out, it means that the plugin downloaded is not meant for said version.<br>Choose the location to install the plugin to (For single users stay with defaults and install into the domain machines).</li></ul><figure class=\"image image-style-align-center image_resized\" style=\"width:75%;\"><img src=\"/uploads/1_129b233b00.PNG\"></figure><ul><li>After the plugin has been installed open SDL Trados Studio.</li><li>Create and Open a new translation project.</li><li>If you don’t see “Termbase Recognition”panel open, you can change it’s visibility under “View”&gt; “Termbase Recognition”.</li></ul><figure class=\"image\"><img src=\"/uploads/2_1857be2662.png\"></figure><ul><li>In the “Termbase Recognition” panel click the “AZ” icon to open settings. “Project Settings” window will be opened.</li></ul><figure class=\"image image_resized\" style=\"width:50%;\"><img src=\"/uploads/3_754b41df36.PNG\"></figure><ul><li>Click on “Use” and select “Tilde Term Provider”.</li></ul><figure class=\"image image_resized\" style=\"width:50%;\"><img src=\"/uploads/4_2a975f42b3.png\"></figure><ul><li>Authentication form will be opened in a browser window. Sign in or register as a new user.</li></ul><figure class=\"image image_resized\" style=\"width:50%;\"><img src=\"/uploads/5_24c7990101.PNG\"></figure><ul><li>After signing in plugin settings window will be opened:</li><li>If you don’t have an active plan a link to subscribe for trial will be displayed. Domain and collection selection will be disabled.</li><li>Users with an active plan, but no private collections created can select and use EuroTermBank collections. Users who have created private collections in the portal, can view and select them under “Tilde Term collections”.</li></ul><p>Select the domain(s) or colection(s) you want to use in your project and click “OK”.</p><figure class=\"image image_resized\" style=\"width:50%;\"><img src=\"/uploads/6_5b931fba44.PNG\"></figure><ul><li>Clicking into a segment that contains terms “Term Recognition” panel will be filled with results from the collections you selected. Terms will be marked in the source segment with a red line over them.</li></ul><figure class=\"image image_resized\" style=\"width:50%;\"><img src=\"/uploads/7_9504d9e103.PNG\"></figure><ul><li>You can change what information is displayed in the “Term Recognition” panel and the look of it by clicking the icon with a cogwheel on it.</li></ul><figure class=\"image\"><img src=\"/uploads/8_f7ff57e7ea.png\"></figure><ul><li>In the “Hitlist Settings” window you can change the font sizes for the results and select the fields to be displayed by clicking “Select Fields”.</li></ul><figure class=\"image image_resized\" style=\"width:50%;\"><img src=\"/uploads/9_b247b7210e.png\"></figure><ul><li>You can enable term, domain and collection name fields. Examples will be displayed only if the collection contains them.</li></ul><figure class=\"image\"><img src=\"/uploads/10_748cab73c3.png\"></figure><ul><li>“Term Recognition” panel can be unpinned and maximized in size for easier viewing.</li></ul><figure class=\"image image_resized\" style=\"width:50%;\"><img src=\"/uploads/11_287338f245.png\"></figure><ul><li>Autocompletion -<strong>&nbsp;</strong>matching terms will be suggested when typing.</li></ul><figure class=\"image image_resized\" style=\"width:50%;\"><img src=\"/uploads/12_7defee0cf1.png\"></figure><ul><li>Clicking on “Termbase Search” you can lookup terms and do “fuzzy search”.</li></ul><figure class=\"image\"><img src=\"/uploads/13_2bd80eefab.png\"></figure><h3>Uninstallation instructions</h3><ul><li>Open \"Sdl Plugin Management\" tool by typing its name in the Start Menu search window.Select the Tilde Term Provider and click “Uninstall” button to remove the plugin. Depending on the way the plug-in is installed, the tool may require Administrator rights to run.</li><li>Select the LetsMT.MTProvider and click “Uninstall” button to remove the plugin.</li></ul>'),(5,'<p>These Terms of Use (hereinafter “Terms”) apply to the use of Tilde Term services, provided by Tilde and as defined below. Please read these Terms carefully before using the services. The user (hereinafter “User”) accepts and agrees that the use of the services is governed by these Terms and that it is bound by these Terms.</p><p><strong>1. Definitions</strong></p><p>1.1 The following words and phrases shall have the meanings and definitions set forth below:</p><p>(a) “Database” means a collection of Terminology, systematically selected, processed, maintained, and updated by Tilde Term.</p><p>(b) “Terminology” means all data consisting of a source side of a single or multi-word term, and the matching target side, which has the same meaning as the source side in a different language and associated metadata, indicating the language pair and other pertinent information about this source/target pairs.</p><p>(c) “Derivative Work” means a work based upon one or more pre-existing works, such as Terminology, in which a work may be recast, transformed, or adapted. A work consisting of editorial revisions, annotations, elaborations or other modifications, which as a whole represent an original work of authorship, is a derivative work. Non-material modifications to a pre-existing work do not constitute a derivative work.</p><p>(d) “Tilde Term” means the services that process the user’s texts, extract term candidates from these in the source language automatically, look up and retrieve translation equivalent candidates in the target language from external terminological resources and other users’ collections, if their users make them public.</p><p><strong>2. Right to use Tilde Term services and Database</strong></p><p>2.1 User is granted a personal, non-transferable, non-exclusive right to use Tilde Term services and Database in accordance with these Terms.</p><p>2.2 The right to access and use the services and data is limited to the remote access and/or use of the services and data by means of electronic access via the Internet.</p><p>2.3 Access to the services and data includes the following limitative rights:</p><ul><li>the right to use the source and the target side of Terminology into a commercial product, provided that User may not resell Terminology as if it is its own new product;</li><li>the right to make Derivative Works;</li><li>the right to use or resell such Derivative Works commercially;</li></ul><p>2.4 Except as expressly stipulated in these Terms or except as expressly allowed by mandatory law, User may not – nor permit any third party to – (a) copy, make available, sublicense, or otherwise commercialise Tilde Term; (b) modify, translate, or otherwise create Derivative Work of Tilde Term; (c) disassemble, decompile, or reverse engineer the object code or source code of Tilde Term.</p><p>2.4 Tilde may take technical measures to protect Tilde Term services. User may not remove or circumvent such technical measures.</p><p>2.5 Tilde reserves the right to audit – or to have a third party audit – whether User complies with the granted rights regarding the use of Tilde Term services and/or Terminology.</p><p>2.6 User is responsible for meeting the technical and functional requirements (provided by Tilde to User) in order to be able to access and use Tilde Term services and/or Terminology. The use of the services and/or data is for the User’s own account and risk. The use of electronic communication facilities in order to gain access to the services and/or data is also for the User’s own account and risk. Tilde will in no event be liable for any damage, loss or costs, including loss of Terminology, or any inability of the User to use the services as a result of a shortcoming, defect or other malfunction of the aforesaid electronic communication facilities. Furthermore, the risk of loss or theft of or damage to Terminology will at all times be borne by the User.</p><p><strong>3. USER’s obligations</strong></p><p>3.1 User warrants it will correctly and properly use Tilde Term services and/or Terminology, which includes but is not limited to compliance with the terms of these Terms. User may in any case not use the services and/or data for any acts and/or conduct contrary to the law, public order, public decency or these Terms. Furthermore, User’s acts and/or conduct must be in accordance with what may in all respects be expected of a responsible and diligent User.</p><p><strong>4. Intellectual property rights</strong></p><p>4.1 All ownership rights and all copyrights, sui generis database rights and patent rights in respect of Tilde Term services exclusively vest in Tilde.</p><p>4.2 The intellectual property rights to Terminology including any trademark rights vest with User or any other third party provider of reference documents and files that are used for the extraction of Terminology. User indicates upon submitting Terminology, reference documents and files whether User owns the intellectual property rights to Terminology, acts on behalf of the owner of the intellectual property rights, or submits Terminology or reference documents and files that are free of intellectual property rights and are as such Fair-to-Share. User does not grant Tilde, without the prior written consent from the trademark owner, the right to use any such trademarks.</p><p><strong>5. Representations and Warranties of User</strong></p><p>5.1 User hereby represents and warrants that to the best of its knowledge i) in the fulfilment of its obligations under these Terms, User will not share Terminology, reference documents, or files which are violating, infringing, or misappropriating any intellectual property rights, proprietary information or any (trade) secrets of any third party and ii) has the right to grant to Tilde the licenses contemplated in these Terms. If User is not the owner of the intellectual property rights, User will provide the name and contact details of the owner of the intellectual property rights, or User will explicitly state that Terminology, reference documents or files are free from intellectual property rights.</p><p>5.2 User hereby further warrants that to the best of its knowledge Terminology, reference documents or files submissions do not contain any viruses, worms, spyware, or other components or instructions that are malicious, deceptive or designed to harm or limit the functionality of a computer. User warrants that procedures have been put in place that reduce the risk of contamination of Database with aforesaid shortcoming.</p><p>5.3 User makes no representation or warranty of any nature as to the correctness of Terminology, reference documents or files that he submits.</p><p><strong>6. Functioning of Tilde Term services</strong></p><p>6.1 Tilde Term services are provided “as is” without warranty of any kind, express or implied, including but not limited to warranties of merchantability, fitness for a particular purpose and non-infringement. In no event shall Tilde or the owners of Terminology vis-à-vis the User be liable for any claim, damages or other liability, whether in an action of contract, tort or otherwise, arising from, out, or in connection with the use of the services and data.</p><p>6.2 Tilde shall not be liable for any damage, loss, demand, liability, claim, cost or expense (including litigation costs and attorney\'s fees) of whatever kind, caused by or resulting from the use of the services and data.</p><p><strong>7. Miscellaneous</strong></p><p>7.1 Tilde may (i) suspend access to and/or the use of the services, or (ii) terminate the granted rights to User, with immediate effect upon written notice if User breaches the terms of these Terms and/or otherwise acts unlawful against Tilde (including but not limited to infringing Tilde’s rights in Tilde Term). If the rights granted to User under these Terms terminate, User shall immediately cease using Tilde Term and destroy any and all entry codes and/or passwords.</p><p>7.2 All matters arising out of or relating to these Terms shall be irrevocably submitted to the exclusive jurisdiction of the courts of the Republic of Latvia.</p><p>7.3 Tilde may amend these Terms. Any such amendments will be reported to User on beforehand. Any continued use of Tilde Term by User will subsequently constitute acceptance of the Terms (as amended).</p><p>7.4 In the event that one or more provisions of these Terms should be determined by an arbitral tribunal or court having competent jurisdiction to be null and void or non-binding, the other provisions of these Terms will continue to be effective. In such case, the parties are obliged to replace the non-binding provisions with other provisions that are binding, in such a way that the intended economic result of the new provisions differs as little as possible from the intended economic result of the original provisions, taking into account the object and the purpose of these Terms. If a part or parts of Terms rendered void, invalid or unenforceable substantially impair the value of the whole Terms to any Party, such party may cancel and terminate Terms by giving written notice to the other party.</p><p>7.5 Any term or condition of a purchase order, invoice or other communication between the Parties, which in any way differ from or add to the terms and conditions of these Terms, will not become binding upon the Parties unless made the subject of an amendment to these Terms. Either Party\'s failure to object to any term or condition contained in any purchase order, invoice or other communication between the Parties shall not be deemed a waiver of the provisions hereof.</p><p>If you have any questions about anything you have read, feel free to contact us by email at&nbsp;<a href=\"mailto:term@tilde.com\">term@tilde.com</a>.</p><p>&nbsp;</p><h2>Tilde Term Privacy Policy</h2><p>We are committed to protecting your privacy and personal data. Therefore, we use your personal data strictly within the legal limits of the applicable data protection laws. With this privacy policy, we inform you of the personal data we collect when you use our website or services.</p><p>The Tilde Term service collects and uses your personal data exclusively within the framework of the provisions of the General Data Protection Regulation. In the following, we inform you about the type, scope, and purposes of the collection and use of personal data.</p><p>1. Definitions</p><p>1.1 The following words and phrases shall have the meanings and definitions set forth below:</p><p>(a) “Terminology” means all data consisting of a source side of a single or multi-word term, and the matching target side, which has the same meaning as the source side in a different language and associated metadata, indicating the language pair and other pertinent information about this source/target pairs.</p><p>(d) “Tilde Term” means the services that process the user’s texts, extract term candidates from these in the source language automatically, look up and retrieve translation equivalent candidates in the target language from external terminological resources and other users’ collections, if their users make them public.</p><h3><strong>1. Data controller</strong></h3><p>The data controller responsible for data processing within the meaning of the General Data Protection Regulation, other data protection laws in force in the Member States of the European Union, and other provisions of a data protection nature is:</p><p>Tilde,<br>Vienības gatve 75A,<br>Rīga, LV-1004.</p><p>Please feel free to address any questions or concerns regarding data protection or privacy to&nbsp;<a href=\"mailto:dpo@tilde.lv\">dpo@tilde.lv</a></p><h3><strong>2. Scope of data protection</strong></h3><p>Data protection concerns personal data as defined in the General Data Protection Regulation, i.e. all information relating to an identified or identifiable natural person. Identifiable is any natural person who can be identified directly or indirectly, in particular by assignment to an identifier such as a name, an identification number, location data, an online identifier, or one or more special characteristics. Usage data is data required to use our website; this data includes the start, end, and extent of the user’s website use.</p><h3><strong>3. Automatic data collection via website access</strong></h3><p>When you access our website: term.tilde.com,&nbsp; your device automatically transmits certain data for technical reasons. The following data is stored separately from any other data you may transmit to us:</p><ul><li>Date and time of access</li><li>Browser type and version</li><li>Operating system</li><li>URL of the website visited prior to ours</li><li>Amount of data sent</li><li>Requesting domain</li><li>Notification of successful data retrieval</li><li>Search term when using a web browser</li><li>Shortened/anonymized IP</li><li>Full IP address (for a maximum of 14 days)</li></ul><p>This data is stored for purely technical reasons and is never associated with any particular individual. The data about website access is used for error analysis, ensuring the security of the systems and to improve our translation service. For legitimate reasons, the full IP address is used to achieve the stated purposes for a very short period of a maximum of 14 days.</p><h3><strong>4. Texts&nbsp;</strong></h3><p>When using the Tilde Term service, the texts (Terminology) you submit are never stored, and are used only insofar as it is necessary to create Collections or perform Search.</p><p>Please note that you may not use our service for any texts containing personal data of any kind.</p><h3><strong>5. Registration</strong></h3><p>You may register with the Tilde Term. The following personal data will be stored for login purposes:</p><ul><li>Email address</li><li>Password</li><li>IP address</li></ul><h3><strong>6. Cookies</strong></h3><p>This webpage, like many others, uses cookies to personalize content and ads, provide social media features and analyse our data traffic.</p><p>By continuing to use our website, you accept our cookies.</p><p>What is a cookie:</p><p>A cookie is a small text file sent to your computer or mobile device when you visit a website that is saved by that website on your computer or mobile device when you open the website. On each subsequent visit, cookies are sent back to the original webpage or any other webpage that recognizes this cookie. Cookies function as a memory of a specific webpage enabling the webpage to remember your computer in following visits including that the cookies can remember your settings or improve your user experience.</p><p>How we use cookies:</p><p>There are multiple types of cookies (persistent and session). They differ by their usage goals and storage period. Over time, the cookies may get updated and customized to improve the service quality level.</p><p>In general, cookies are used for:</p><ul><li>Provision of services – cookies provide basic functions such as page navigation.</li><li>User settings – cookies enable a website to remember the information that changes the way the website works or looks, for example, the recommended language or your location region.</li><li>Usage statistics and analysis – by collecting and anonymously reviewing the information, cookies help owners of websites to understand how users interact with their websites.</li><li>Marketing – cookies are used to track visitors to websites. The goal is to show relevant ads that are of interest to an individual user.</li></ul><p>We do not use cookies to collect personal information about users. However, some processed information can be considered personal data.</p><p>We may share the information about how you use our site with our media, social, advertising and analysis partners.</p><p>If you would like to limit cookies or block them on our website, you may do so by editing the settings of your web browser. However, then you will need to customize settings every time you visit the website, and there is a probability that some services and features might not work.</p><h3><strong>7. Google Analytics (with an anonymization function)</strong></h3><p>We use Google Analytics (with an anonymization function), a web analytics service provided by Google Inc. (\"Google\"). Google Analytics uses cookies which permit an analysis of your use of the website. The information about your website use generated by the cookie (including your truncated IP address) is transmitted to a server controlled by Google in the USA and is stored there. Google uses this information to analyze your use of the website, to generate reports about website activities for website operators, and to provide further services related to website and internet use. Google may also share such information with third parties to the extent it is legally required to do so and/or to the extent third parties process data on behalf of Google.</p><p>You can find detailed information about how Google uses your data in&nbsp;<a href=\"https://www.google.com/policies/privacy/\"><strong>Google’s privacy policy</strong></a>.</p><p>We use Google Analytics with the anonymization function. By means of this addition, Google shortens and anonymizes the IP address of the Internet connection of the person concerned, if our Internet pages are accessed from a member state of the European Union or from another governmental party to the Agreement on the European Economic Area.</p><p>You may deactivate Google Analytics with the help of a browser add-on if you do not want this website analysis. This add-on can be downloaded&nbsp;<a href=\"https://tools.google.com/dlpage/gaoptout?hl=en\"><strong>here</strong></a>.</p><p>User-based event data at Google Analytics is deleted after 38 months.</p><h3><strong>8. Data security</strong></h3><p>Your visits to our website are protected by state-of-the-art encryption technology. The level of protection always depends on which encryption your Internet browser supports. You can tell whether an individual page of our website is encrypted by the key or closed lock symbol in the status bar of your browser. We also use appropriate technical and organizational security measures to protect your data against accidental or intentional manipulation, partial or complete loss, destruction, or against unauthorized access by third parties. Our security measures are continuously improved in line with technological developments.</p><h3><strong>9. Your rights</strong></h3><p>You have the following rights under European Union law. If you wish to exercise any of the rights below, simply write to us at the above address.</p><ul><li>Right to confirmation and right to information - we will be happy to confirm whether we process your personal data, what data it is and for what purpose it is processed.</li><li>Right to rectification - if the data we store is incorrect, we will of course be happy to correct it.</li><li>Right of erasure - if you want your personal data to be deleted, we will, as far as legally possible, comply with your request. If data must be kept for legal reasons, it will be blocked. The data is then no longer available for further use.</li><li>Right to restriction of processing - should you wish to restrict use, we will, as far as legally possible, comply with your request.</li><li>Right of revocation - if you wish to revoke any consents already given, we will pursue your request accordingly.</li><li>Right to object - if your personal data are processed on the basis of legitimate interests pursuant to point (f) of Article 6(1) of the GDPR, you have the right to object to the processing of your personal data pursuant to Article 21 of the GDPR if there are reasons for doing so that result from your particular situation or are against direct marketing. In the latter case, you have a general right to object, which we will accept without a particular situation being stated. If you would like to exercise your right of revocation or objection, simply send an e-mail to&nbsp;<a href=\"mailto:dpo@tilde.lv\">dpo@tilde.lv</a>.</li></ul><p>You also have the right to lodge a complaint to a supervisory authority about the processing of your personal data.</p><h3><strong>10. Changes to this privacy policy</strong></h3><p>We reserve the right to modify this privacy policy.</p><p>Last updated: February 2021</p><p>&nbsp;</p>'),(6,'<p>Privacy policy</p>'),(7,'<p>Adding terminology to your translation workflow has never been easier. You can seamlessly integrate Tilde Term in SDL Trados (2015-2021), Wordfast Anywhere, OmegaT, and memoQ.</p>'),(8,'<p><span style=\"color:#353535;\">Using&nbsp;powerful&nbsp;API,&nbsp;Tilde&nbsp;Term&nbsp;services&nbsp;can&nbsp;be&nbsp;easily&nbsp;connected&nbsp;to&nbsp;virtually&nbsp;any&nbsp;environment,&nbsp;product,&nbsp;or&nbsp;solution.</span></p>'),(10,'<p><span style=\"color:#353535;\">Terminology&nbsp;combined&nbsp;with&nbsp;machine&nbsp;translation&nbsp;is&nbsp;the&nbsp;perfect&nbsp;combination.&nbsp;Tilde&nbsp;Term&nbsp;seamlessly&nbsp;integrates&nbsp;with&nbsp;Tilde&nbsp;Machine&nbsp;Translation&nbsp;for&nbsp;better&nbsp;performance.&nbsp;</span></p>'),(11,'<p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">To maximize your productivity and efficiency, you can easily connect Tilde Term to all your favorite tools.</span></p>'),(13,'<h1><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\"><strong>Customize your terminology toolkit</strong></span></h1><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">One size does not fill all so we give you the flexibility to customize your terminology toolkit for your unique needs. You can insert custom HTML in your pages, customize term synchronization and tailor your toolkit to suit your individual needs. For more information contact our support team.&nbsp;&nbsp;</span></p><figure class=\"image image-style-align-left image_resized\" style=\"width:50%;\"><img src=\"/uploads/3_illustrations_842e5c0d2d.svg\"></figure>'),(14,'<h2><span class=\"text-small\" style=\"color:rgb(0,0,0);\"><strong>Reliable terminology ensured by Federated Network</strong></span><span style=\"color:rgb(0,0,0);\">&nbsp;</span></h2><p><span style=\"color:rgb(0,0,0);\">EuroTermBank is the central federated node, which accumulates all the individual, local and national nodes in one place providing current, correct, consistent terminological data. Organizations, institutions, SMEs and even individuals can create their own local federated nodes and link them to the central EuroTermBank, which in turn is linked to ELRC-SHARE. The individual nodes regularly synchronise terminology changes with the central TermBank. This way, terminology data can be effortlessly created, shared, managed and synchronized so everyone is always up to date and on the same page.</span></p><p><span style=\"color:rgb(0,0,0);\">&nbsp;</span></p><h2><span style=\"color:rgb(0,0,0);\"><strong>Terminology synchronization with the largest database</strong>&nbsp;</span></h2><p><span style=\"color:rgb(0,0,0);\">The </span><a href=\"https://www.eurotermbank.com/\"><span style=\"color:rgb(5,99,193);\"><u>EuroTermBank</u></span></a><span style=\"color:rgb(0,0,0);\"> is a largest centralized online terminology database for European Union and Icelandic languages containing more than 1,500,000 terms. The EuroTermBank is interlinked with other national and EU terminology banks, thus it consolidates European terminology in one place, and enables easy terminology access and exchange for everyone.&nbsp;&nbsp;</span></p><p><span style=\"color:rgb(0,0,0);\">&nbsp;</span></p><p><span style=\"color:rgb(0,0,0);\">EuroTermBank Federated Network is one of kind terminology network created by terminology experts from different European organizations. It has been development and maintained by language technology company </span><a href=\"https://www.tilde.com/\"><span style=\"color:rgb(5,99,193);\"><u>Tilde.</u></span></a><span style=\"color:rgb(0,0,0);\">&nbsp;&nbsp;</span></p><p><span style=\"color:rgb(0,0,0);\">&nbsp;</span></p><h2><span style=\"color:rgb(0,0,0);\"><strong>Project Partners</strong>&nbsp;</span></h2><p>&nbsp;</p><div class=\"raw-html-embed\"><div class=\"row no-gutters pt-5\" style=\"background-color: #fff;\"><a class=\"col-md-4 col-lg-2 mb-5 d-flex align-items-center justify-content-center right-border\" href=\"https://www.sis.se/\" target=\"_blank\" rel=\"noreferrer\"><img alt=\"institut@3x.png\" data-entity-type=\"file\" data-entity-uuid=\"f9b141e7-eee3-47bb-b387-80798017552f\" src=\"https://es-cms.eurotermbank.com//sites/default/files/inline-images/SIS_0.png\" width=\"120\"> </a> <a class=\"col-md-4 col-lg-2 mb-5 d-flex align-items-center justify-content-center right-border\" href=\"https://www.sprakochfolkminnen.se/\" target=\"_blank\" rel=\"noreferrer\"> <img alt=\"isof.png\" data-entity-type=\"\" data-entity-uuid=\"\" src=\"https://es-cms.eurotermbank.com//sites/default/files/inline-images/isof.png\" width=\"120\"> </a> <a class=\"col-md-4 col-lg-2 mb-5 d-flex align-items-center justify-content-center right-border\" href=\"http://www.lki.lt/\" target=\"_blank\" rel=\"noreferrer\"> <img alt=\"lietuvas.png\" data-entity-type=\"\" data-entity-uuid=\"\" src=\"https://es-cms.eurotermbank.com//sites/default/files/inline-images/lietuvas.png\" width=\"120\"> </a> <a class=\"col-md-4 col-lg-2 mb-5 d-flex align-items-c